import shortid from 'shortid';

export const reasons = [
  { id: shortid.generate(), reason: 'reasons 1' },
  { id: shortid.generate(), reason: 'reasons 2' },
  { id: shortid.generate(), reason: 'reasons 3' },
  { id: shortid.generate(), reason: 'reasons 4' },
  { id: shortid.generate(), reason: 'reasons 5' },
  { id: shortid.generate(), reason: 'reasons 6' },
  { id: shortid.generate(), reason: 'reasons 7' },
];
